const transformCouponLineThrough = lineThrough => {
  const styles = {};
  for (const line of lineThrough) {
    switch (line) {
      case '0':
        styles.titleTextDecoration = 'line-through';
        break;
      case '1':
        styles.loadTextDecoration = 'line-through';
        break;
      case '2':
        styles.subtitleTextDecoration = 'line-through';
        break;
    }
  }
  return styles;
};

